  const [index, setIndex] = useState(0);

  useEffect(() => {
    if(index < text.length) {
      const timeout = setTimeout(() => {
        setDisplayText(prev => prev + text[index])
        setIndex
      })
    }
  })

  return (
    <div className='home'>
        <h1 className='wlcm-line'>Wlcm to Fresh Finds 
